import Link from 'next/link';

const Aside = () => {
    return (
        <div style={sideBarWidth}>
            <aside>
                <Link href="/">
                    <a className="link">Home</a>
                </Link>
                <Link href="/about">
                    <a style={linkStyle}>About</a>
                </Link>
            </aside>
            <footer>
                <div>Copyright Next App</div>
            </footer>
            <style jsx>{`
            .link {
                display: block;
            }
            `}</style>
        </div>
    );
}

const linkStyle = {
    display: 'block',
}
const sideBarWidth = {
    width: '30%',
}

export default Aside;
